    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS) St. Petersburg
    Coastal and Marine Science Center (SPCMSC) in Florida and the USGS Lower Mississippi-Gulf
    Water Science Center (LMG WSC) in Montgomery, Alabama, collaborated to gather alongshore
    terrestrial-based lidar beach elevation data at Fire Island, New York. This high-resolution
    elevation dataset was collected on June 11, 2014, to characterize beach topography
    and document ongoing beach evolution and recovery, and is part of the ongoing beach
    monitoring within the Hurricane Sandy Supplemental Project GS2-2B. This USGS data
    series includes the resulting processed elevation point data (xyz) and an interpolated
    digital elevation model (DEM).",nt"license_title": null,nt"extras": [{ntt"key":
